import React from 'react';

class Products extends React.Component {
	render() {
		return(
			<div className="jumbotron" style={{margin: 0}}>
				<div className="col-sm-3">
					<h2>Search</h2>
				</div>
				<div className="col-sm-9">
					sample text
				</div>
			</div>
		)
	}
}

export default Products;
